import axios from 'axios';
import React, { useEffect, useState } from 'react'
import DateTime from '../date-time/DateTime';

function InterNationalCovidUpdate() {
    const headingText = "Welcome to Int. Covid-19 Live Updates";

    const [internationalData, setInternationalData ] = useState([]);
    const getUdpatedData = async () => {
        try {
            const res = await axios("https://api.covid19api.com/summary");
            setInternationalData(res.data.Countries);
            console.log(res.data.Countries[0]);
        } catch (error) {
            console.log(error);
        }
    }

    useEffect(() => { getUdpatedData(); }, []);

    return (
        <div>
            {/* {Header} */}
            <DateTime headingTextData={headingText} />
            <br />
            <div className="container">
                <table className="table table-bordered">
                    <thead>
                        <tr>
                            <th>#</th>
                            <th>Country</th>
                            <th>Country</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            internationalData.map((e, i) => {
                                return <tr key={i}>
                                    <td>{i}</td>
                                    <th>{e.Country}</th>
                                    <td>{e.CountryCode}</td>
                                    <td>{e.Date}</td>
                                    <td>{e.NewConfirmed}</td>
                                    <td>{e.NewRecovered}</td>
                                    <td>{e.TotalConfirmed}</td>
                                    <td>{e.TotalDeaths}</td>
                                    Country: "Afghanistan"
                                    CountryCode: "AF"
                                    Date: "2021-08-09T08:35:39.706Z"
                                    ID: "4d3fc234-8f4d-43dd-9da7-2ccd310ece10"
                                    NewConfirmed: 0
                                    NewDeaths: 0
                                    NewRecovered: 0
                                    Premium: {}
                                    Slug: "afghanistan"
                                    TotalConfirmed: 149810
                                    TotalDeaths: 6879

                                </tr>                                
                            })
                        }
                        <tr>
                            <th>2</th>
                            <td>Jacob</td>
                            <td>Thornton</td>
                            <td>@fat</td>
                        </tr>
                    </tbody>
                </table>
            </div>
        </div>

    )
}

export default InterNationalCovidUpdate;
